import React from "react";
import Count from "./count";

function App5(){
    return(
      <div className='count'>
        <Count/>
      </div>
    )
  }

  document.addEventListener('DOMContentLoaded', () => {
    ReactDOM.render(
      <App5/>,
      document.getElementById('count')
    )
    })
